import { Layout, Page, EmptyState } from "@shopify/polaris";

const Index = () => (
  <div>
    <Page>
      <Layout>
        <EmptyState variation="positive">
          Sample app using Rect and Next.js
        </EmptyState>
      </Layout>
    </Page>
  </div>
);

export default Index;
